import React, { useState } from 'react'
import './Components.css';

import {
    Col,
    Row,
    Image
} from 'react-bootstrap';

const BULLE_IMODO = require('../../assets/images/home/bulle-imodo.png');

function SideMenu() {
    return (
        <>
            <div className="side-menu-wizard-btn d-flex">
                <Row stlye={{background: 'yellow'}} className={"m-auto"}> 
                    <Col className="d-flex">
                        <Image src={BULLE_IMODO} className="m-auto" />
                    </Col>
                    
                    <Col className="d-flex">
                        <p className="side-menu-wizard-text m-auto">Auto-moderation wizard</p>
                    </Col>
                </Row>
            </div>

        </>
    )
}

export default SideMenu;
